import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  text-align: center;
  padding: 20px;
`;

const Home = () => {
  return (
    <Container>
      <h1>Witamy w Winter Rental</h1>
      <p>Rezerwuj swój sprzęt zimowy w prosty sposób!</p>
    </Container>
  );
};

export default Home;
